style.css:
@-moz-document domain("wikiskola.se"), domain("wikiskola.thorengruppen.se") {
* {
background: #262626 !important;
border-color: #262626 !important;
color: #9a9a9a !important;
}

#p-logo a {
background-position:center center !important;
background-repeat:no-repeat !important;
}


a{
color: #000000 !important;
}

a:visited{
color: #ccc !important;
}

a:link{
color: #ec2260 !important;
font-weight: bold !important;
}

a:hover, a:hover span {
color: #fff !important;
text-decoration: underline !important;
}

#content, #content * {
background: #202020 !important;
border-color: #555 !important;
}

#content {
-moz-border-radius: 10px;
-webkit-border-radius: 10px;
border-radius: 10px;
}

#toc, #toc * {
background: #262626 !important;
border-color: #262626 !important;
}

#toc {
-moz-border-radius: 10px;
-webkit-border-radius: 10px;
border-radius: 10px;
}

#p-cactions li.selected a, #p-cactions li a, #p-cactions li a:hover {
padding: 0 1em 0.1em !important;
}

#bodyContent pre {
background: #1a1a1a !important;
}




img[src*="http://wikiskola.se/images/W3_3.gif"] {
width: 160px !important;
height: 160px !important;
background:url"http://wikiskola.se/images/W3_3.gif";
padding-left: 150px !important;
}

img[src*="http://wikiskola.se/images/W3_3.gif"] {
width: 0px !important;
height: 50px !important;
background:url("http://wikiskola.se/images/W3_3.gif") no-repeat !important;
padding-left: 174px !important;
}

#p-logo a {
background-image: url("http://wikiskola.thorengruppen.se/images/Wikiskolaloggamork.png") !important;
}





img[src*="http://wikiskola.se/images/W3_3.gif"], img[src*="http://wikiskola.se/images/W3_3.gif"], img[src*="http://wikiskola.se/images/W3_3.gif"] {
width: 0px !important;
background: none !important;
}

.portlet li {
list-style-image: none !important;
}

ul {
list-style-image: none !important;
}
}
